import builder from '../util/https-base'

const { https } = builder("/cliente")

const getAll = () => {
    return https.get("/all")
}

var data = {"uuid":"0c77c59b-1951-4a74-8175-0c27fd01727b"};

const getByUUID = (uuid) => {
    return https.get("/id",data)
}

export default {
    getAll,
    getByUUID
}
